import Vue from 'vue'
import VueRouter from 'vue-router'
import Carga from '/src/views/Carga.vue'

Vue.use(VueRouter)

const routes = new VueRouter({
    routes:[
      {
        path: '/carga',
        name: 'carga',
        component: Carga
      },
    ]
  })

const router = new VueRouter({
    mode:'history',
    base: process.env.BASE_URL,
    routes,
})

export default router
